import { EventEmitter, Injectable, Output } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class OverlayToggleService {
  @Output() clickedEvent = new EventEmitter<boolean>();

  buttonClicked(){
    this.clickedEvent.emit(true);
  }
  constructor() { }
}
